sources.style.css:
html,
body {
  margin: 0;
  font-size: 100%;
  background: #fff;
  font-family: "Work Sans", sans-serif;
}

h1,
h2,
h3,
h4,
h5,
h6 {
  margin: 0;
  font-family: "Work Sans", sans-serif;
}

p {
  margin: 0;
  letter-spacing: 1px;
  font-size: 0.9em;
}

ul {
  margin: 0;
  padding: 0;
}

label {
  margin: 0;
}

/*-- header --*/

#teamPhoto {
  background-image: url("/images/2.jpg");
  width: 100vw;
  height: 100vh;
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
  box-shadow: inset 0 0 0 2000px rgba(198, 239, 211, 0.3);
}

#headerTitle {
  text-align: center;
  padding-top: 500px;
  font-size: 50px;
}

#schoolDescription {
  text-align: center;
  padding-top: 10px;
  font-size: 20px;
}
/*--header--*/

.content {
  margin: 0;
  padding: 0px;
}

.content p:last-child {
  margin: 0;
}

.content a.button {
  display: inline-block;
  padding: 10px 20px;
  background: #ff0;
  color: #000;
  text-decoration: none;
}

.content a.button:hover {
  background: #000;
  color: #ff0;
}

.content.title {
  position: relative;
  background: #333;
}

.navbar-nav {
  float: right;
  margin: 0;
}

.content.title h1 span.demo {
  display: inline-block;
  font-size: 0.5em;
  padding: 10px;
  background: #fff;
  color: #333;
  vertical-align: top;
}

.content.white {
  background: #fff;
  padding: 1em 0;
}

.content.black {
  background: #000;
}

.content.black p {
  color: #999;
}

.content.black p a {
  color: #08c;
}

.navbar {
  position: relative;
  min-height: 50px;
  margin-bottom: 0 !important;
  border: 1px solid transparent;
}

.navbar-default {
  background-color: #fff;
  border-color: #fff;
}

.navbar-default a.navbar-brand h1 {
  color: #282828;
  font-weight: bold;
}

.navbar-default .navbar-nav > li > a {
  color: #282828;
  font-size: 0.9em;
  letter-spacing: 1px;
  font-weight: 600;
  text-transform: uppercase;
  padding: 14px 8px;
}

.main-content {
  padding: 3em 0;
}

@media (max-width: 767px) {
  .dropdown-menu.multi-column {
    min-width: 240px !important;
    overflow-x: hidden;
  }
  .navbar-nav {
    float: left;
    margin: 0;
    margin-left: 0em;
    width: 100%;
    background: #eee;
    margin-top: 1em;
  }
}

/* about */
.heading-agileinfo {
  font-weight: 600;
  letter-spacing: 0.5px;
  font-size: 40px;
  margin-bottom: 1.9em;
  text-align: center;
  color: #ff4f81;
  text-transform: uppercase;
  position: relative;
  margin-top: 0;
}
.heading-agileinfo span {
  display: block;
  font-size: 17px !important;
  margin-top: 1em;
  letter-spacing: 4px;
  text-transform: capitalize;
  color: #000000;
  font-weight: 500;
}
.heading-agileinfo span:after {
  content: "";
  background: #212121;
  height: 2px;
  width: 70px;
  position: absolute;
  top: 132%;
  right: 47%;
}
a.wthree-.about-link {
  color: #fff;
  border: 1px solid #03afdd;
  background: #03afdd;
  border-radius: 0;
  padding: 0.5em 2.5em;
  outline: none;
  font-size: 1em;
  margin: 4% auto 0;
  font-weight: 600;
  letter-spacing: 4px;
  display: inline-block;
  text-transform: uppercase;
}

.agileits-about-grid p {
  width: 80%;
  margin: 0 auto;
  font-size: 15px;
  line-height: 1.8em;
  color: #999;
}
.agileits-about-grid1 {
  border: 1px solid #000;
}

.agileits-about-grid2 {
  border: 1px solid #000;
  border-left: none;
  border-right: none;
}

.agileits-about-grid3 {
  border: 1px solid #000;
}
.agile-about {
  padding: 5em 0 0;
}

/* //about */

/* about-bottom */
.agileits-about-btm {
  padding: 5em 0;
}

.ab1 {
  padding: 2em;
}
.ab1 span {
  color: #000;
  font-size: 2em;
}

h4.agileinfo-head {
  color: #ff4f81;
  text-transform: capitalize;
  font-weight: 600;
  margin: 0.7em 0;
  font-size: 1.8em;
}

.ab1 h5 {
  color: #000;
  font-size: 1em;
  text-transform: uppercase;
  font-weight: 600;
  margin: 1em 0 0.2em;
}
.ab1 p {
  color: #999;
  font-size: 15px;
  line-height: 1.8em;
  margin: 10px 0 0;
}

/* //about-bottom */

/*-- stats --*/

.w3layouts_stats_left {
  text-align: center;
}

.w3layouts_stats_left p {
  font-size: 3em;
  font-weight: 100;
  letter-spacing: 2px;
  color: #ffffff;
  margin: 0.1em 0 0.1em 0;
}
.w3layouts_stats_left h3 {
  font-size: 1.3em;
  color: #ff4f81;
  letter-spacing: 3px;
  margin: 30px 0 20px;
  font-weight: 600;
}

.w3layouts_stats_left span {
  font-size: 2.5em;
  color: #fff;
}

.w3l_stats_bottom_grid_left img {
  margin: 0 auto;
}

/* .stats {
  text-align: center;
  background: url(../images/banner2.jpg) no-repeat 0px 0px;
  background-size: cover;
  -webkit-background-size: cover;
  -moz-background-size: cover;
  -o-background-size: cover;
  -ms-background-size: cover;
  background-attachment: fixed;
  padding: 5em 0;
} */

.agile_inner_info_stats {
  margin-top: 2em;
}

span.ttt {
  color: #fff;
}
/*-- //stats --*/

/*-- news --*/
.news {
  padding: 5em 0;
}
.news-agileinfo {
  margin-top: 5em;
}
.wthree-news-grids {
  margin-top: 5em;
}
.datew3-agileits-info {
  padding-left: 2em;
}
.datew3-agileits img.img-responsive {
  -webkit-transition: 0.5s all;
  -moz-transition: 0.5s all;
  transition: 0.5s all;
  overflow: hidden;
  border: solid #dedede;
}
.datew3-agileits-info h5 {
  margin: 0;
}
.datew3-agileits-info h5 a {
  color: #000;
  text-decoration: none;
  font-size: 1.4em;
  text-transform: uppercase;
  font-weight: 600;
  letter-spacing: 1px;
}
.datew3-agileits-info h5 a:hover {
  color: #ff4f81;
}
.datew3-agileits-info h6 {
  font-size: 1em;
  color: #ff4f81;
  font-weight: 600;
  margin: 1em 0;
  letter-spacing: 1px;
}
.datew3-agileits-info p {
  margin: 1em 0 0;
  color: #999999;
  font-size: 0.9em;
  line-height: 1.8em;
}
.datew3-agileits.datew3-agileits-fltrt {
  float: right;
}
.news-right h4 {
  color: #000;
  font-size: 2em;
  margin: 0;
}
.news-right {
  padding-left: 4em;
}
.achievesw3-agile {
  background: #97f302;
  padding: 1em;
  display: inline-block;
  margin: 2em 0 0 0;
}
.achievesw3-agile ul {
  padding: 0;
  margin: 0;
}
.achievesw3-agile ul li {
  display: block;
  margin: 1.3em 1em;
}
.achievesw3-agile ul li a {
  font-size: 1em;
  color: #fff;
  transition: 0.5s all;
  -webkit-transition: 0.5s all;
  -moz-transition: 0.5s all;
  -ms-transition: 0.5s all;
  -o-transition: 0.5s all;
  text-decoration: none;
}
.achievesw3-agile ul li a:hover {
  color: #000;
}
.achievesw3-agile ul li a i.fa {
  margin-right: 0.8em;
}
/*-- //news --*/

/*-- gallery --*/
.gallery {
  padding: 5em 0;
}
.grid {
  position: relative;
  clear: both;
  margin: 0 auto;
  max-width: 1000px;
  list-style: none;
  text-align: center;
  background: rgba(0, 0, 0, 0.86);
}
/* Common style */
.grid {
  position: relative;
  overflow: hidden;
  margin: 10px 0;
  height: auto;
  text-align: center;
  cursor: pointer;
}
.grid img {
  position: relative;
  display: block;
  width: 100%;
  opacity: 0.8;
}

.grid .figcaption {
  padding: 2em;
  color: rgba(0, 0, 0, 0.5);
  text-transform: capitalize;
  font-size: 1.25em;
  -webkit-backface-visibility: hidden;
  backface-visibility: hidden;
}
.grid .figcaption,
.grid .figcaption > a {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
}

.grid .figcaption > a {
  z-index: 1000;
  text-indent: 200%;
  white-space: nowrap;
  font-size: 0;
  opacity: 0;
}
.grid p {
  letter-spacing: 1px;
  font-size: 68.5%;
}
.effect-apollo img {
  opacity: 0.95;
  -webkit-transition: opacity 0.35s, -webkit-transform 0.35s;
  transition: opacity 0.35s, transform 0.35s;
  -webkit-transform: scale3d(1.05, 1.05, 1);
  -moz-transform: scale3d(1.05, 1.05, 1);
  -o-transform: scale3d(1.05, 1.05, 1);
  -ms-transform: scale3d(1.05, 1.05, 1);
  transform: scale3d(1.05, 1.05, 1);
}
.effect-apollo .figcaption::before {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: rgba(0, 0, 0, 0.5);
  content: "";
  -webkit-transition: -webkit-transform 0.6s;
  transition: transform 0.6s;
  -webkit-transform: scale3d(1.9, 1.4, 1) rotate3d(0, 0, 1, 45deg)
    translate3d(0, -100%, 0);
  transform: scale3d(1.9, 1.4, 1) rotate3d(0, 0, 1, 45deg)
    translate3d(0, -100%, 0);
}
.effect-apollo p {
  position: absolute;
  right: 0;
  bottom: 0;
  color: #fff;
  margin: 3em;
  padding: 0 1em;
  border-right: 4px solid #fff;
  text-align: right;
  opacity: 0;
  -webkit-transition: opacity 0.35s;
  transition: opacity 0.35s;
}
.effect-apollo:hover img {
  -webkit-transform: scale3d(1, 1, 1);
  -moz-transform: scale3d(1, 1, 1);
  -o-transform: scale3d(1, 1, 1);
  -ms-transform: scale3d(1, 1, 1);
  transform: scale3d(1, 1, 1);
  opacity: 0.4;
}
.effect-apollo:hover .figcaption::before {
  -webkit-transform: scale3d(1.9, 1.4, 1) rotate3d(0, 0, 1, 45deg)
    translate3d(0, 100%, 0);
  transform: scale3d(1.9, 1.4, 1) rotate3d(0, 0, 1, 45deg)
    translate3d(0, 100%, 0);
}
.effect-apollo:hover p {
  opacity: 1;
  -webkit-transition-delay: 0.1s;
  transition-delay: 0.1s;
}
/*-- //gallery --*/

/*-- contact --*/
.w3layouts_mail_grid input[type="text"],
.w3layouts_mail_grid input[type="email"],
.w3layouts_mail_grid textarea {
  outline: none;
  padding: 14px;
  font-size: 14px;
  color: #212121;
  background: #f5f5f5;
  width: 100%;
