.contact-right {
  padding-left: 1em;
  float: left;
  width: 65%;
}

.contact-form input[type="text"],
.contact-form input[type="email"],
.contact-form textarea {
  font-size: 15px;
  letter-spacing: 1px;
  color: #fff;
  padding: 0.5em 1em;
  border: 0;
  width: 100%;
  border-bottom: 1px solid #dcdcdc;
  background: none;
